import { Router } from 'express'
const router = Router()
const app = require('../app')

router.get('/matchesFromChamp/:champ', (req, res) => {
    let db = app.getDatabase()

    let collection = db.collection("matches")

    let data = collection.findMany({ info : { participants : { championId : req.params.champ } } })

    res.send(data);
})

export default router
